// AdminList.js
import React from 'react';
import './AdminList.css'; // CSS file for styling

function AdminList() {
  // Static data for demonstration
  const admins = [
    { id: 1, name: 'Alice Johnson', email: 'alice.johnson@example.com', role: 'Super Admin' },
    { id: 2, name: 'Bob Smith', email: 'bob.smith@example.com', role: 'Admin' },
    { id: 3, name: 'Charlie Davis', email: 'charlie.davis@example.com', role: 'Moderator' },
    { id: 4, name: 'Dana Scott', email: 'dana.scott@example.com', role: 'Admin' },
  ];

  return (
    <div className="admin-list-container">
      <h2>Admin List</h2>
      <table className="admin-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Email</th>
            <th>Role</th>
          </tr>
        </thead>
        <tbody>
          {admins.map((admin) => (
            <tr key={admin.id}>
              <td>{admin.id}</td>
              <td>{admin.name}</td>
              <td>{admin.email}</td>
              <td>{admin.role}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default AdminList;
